('ja', '_template', 'atutor_accessibility_text', '<p>ATutor includes a variety of features designed to ensure that content is accessible to all potential users, including those with slow Internet connections, older Web browsers, and people with disabilities using assistive technologies to access the Web. These features are described in detail below. Depending on the theme being used, ATutor may include all or some of the features listed here. The default theme includes them all.</p>\\r\\n<h3>Screen Reader Settings</h3>\\r\\n<p>Though screen readers typically work well with ATutor, some default settings should be adjusted:</p>\\r\\n<ol>\\r\\n<li>Set screen reader Link Text setting to read the longer of either link text or associated title text.  In many cases link text needs to be truncated so it will fit in the available space. Title text associated with those shortened links will contain the full text.</li>\\r\\n</ol>\\r\\n\\r\\n<h3>Features</h3>\\r\\n<ol>\\r\\n<li><strong>ByPass Links:</strong> In the top left corner of ATutor is a  hidden bypass link that allows assistive technology users to skip over the navigation elements and jump directly to an anchor at the top of the content being displayed. Press the Tab key once after a page has finished loading to advance to the first bypass link then press Enter to reposition the content to the top of your screen. The content anchor can also be accessed with an accesskey [Alt-c], so it is possible to jump to the top of the content area no matter where the cursor might be located on the screen.<br /><br />\\r\\n\\r\\nOther bypass links include: \\jump past table\\ so users can skip over various data table to quickly access content that may appear after the table; \\jump past codes\\, so users can skip over the emoticon codes near the bottom of message posting form in the Forums.<br /><br /><br />\\r\\n\\r\\nUsers of current browsers and assistive technologies that support WAI-ARIA landmarks can take advantage of this alternate means of navigating through the ATutor interface. Pressing the semi-colon key repeatedly will cycle through all the landmarks, and once the desired landmark is announced continue reading from that point. <br />\\r\\n\\r\\n</li>\\r\\n\\r\\n<li><strong>Accesskeys:</strong> Keyboard accessibility has been added to many ATutor features. To activate accesskeys, press Alt plus the assigned number, letter, or character. Accesskeys are assigned dynamically to the tabs in the Main Navigation. The first tab will be assigned [Alt-1], the second tab will be assigned [Alt-2], and so on.  Note that not all browsers support accesskeys.<br /><br />\\r\\n\\r\\nGeneral AccessKeys\\r\\n<ul>\\r\\n<li>[Alt-1 to Alt-0] Main Navigation Tabs</li>\\r\\n<li>[Alt-,] Previous topic (i.e. Left angle bracket <)</li>\\r\\n<li>[Alt-.] Next topic (i.e. Right angle bracket > )</li>\\r\\n<li>[Alt-.] Resume (i.e. Right angle bracket > while outside the course content)</li>\\r\\n<li>[Alt-j] Jump Menu</li>\\r\\n<li>[Alt-s] Submit (active on many form pages)</li>\\r\\n<li>[Alt-c] Jump to content top (top and navigation bypass link)</li>\\r\\n</ul>\\r\\n\\r\\nContent Editor AccessKeys\\r\\n<ul>\\r\\n<li>[Alt-n] Content Tab</li>\\r\\n<li>[Alt-p] Properties Tab</li>\\r\\n<li>[Alt-g] Glossary Tab</li>\\r\\n<li>[Alt-r] Preview Tab</li>\\r\\n<li>[Alt-a] Accessibility Tab</li>\\r\\n<li>[Alt-s] Save</li>\\r\\n</ul>\\r\\n\\r\\nChat AccessKeys\\r\\n<ul>\\r\\n<li>[Alt-c] Jump to Compose Message field</li>\\r\\n<li>[Alt-r] Refresh Messages</li>\\r\\n<li>[Alt-m] Jump to Message List</li>\\r\\n<li>[Alt-q] Quit Chat</li>\\r\\n</ul>\\r\\n\\r\\nInbox AccessKeys\\r\\n<ul>\\r\\n<li>[Alt-r] Reply to Messages</li>\\r\\n</ul>\\r\\n<br />\\r\\n\\r\\nVisual Editor AccessKeys\\r\\n<ul>\\r\\n<li>[Alt-q] jump to button bar</li>\\r\\n<li>[Alt-z] jump to content area of editor</li>\\r\\n<li>[Alt-x] jump to element path (bottm)</li>\\r\\n</ul>\\r\\n</li>\\r\\n\\r\\n<li><strong>Accessibility Verifier: </strong>While using the ATutor Content Editor, instructors can check the accessibility of their content to be sure it can accessed by all students, including those using assistive technologies, or older technologies. While using the Content Editor, select [Alt-a] to open the accessibility verifier.</li>\\r\\n\\r\\n<li><strong>Alternative Text: </strong>All meaningful images in ATutor include a text alternative that describes the image or its function. Where images are not meaningful the Alt attribute is left empty so assistive technologies  will ignore the image.</li>\\r\\n\\r\\n<li><strong>Alternative Navigation: </strong>Global, hierarchical, and sequential navigation tools are available so users can view or structure content in a manner that suits their style of learning.  The ATutor SiteMap provides a full list of all content and tools available, so all features in a course can be accessed from a single location.</li>\\r\\n\\r\\n<li><strong>Resume/Continue: </strong>ATutor remembers the last page accessed when users leave the course content, to go to the Forums for instance, so they can quickly find their way back to where they left off. The content location is also remembered between sessions, so when returning to ATutor, users can simply choose the Resume link in the course listing on My Courses, or select the the resume link in the breadcrumbs at the top of the screen once in a course. Using the [Alt-.] accesskey will also return a user to the last content page they were viewing after they have entered into a course.</li>\\r\\n\\r\\n<li><strong>Hide Menus:</strong> For users of older assistive technologies that do not support columnar text laid out in tables, it is possible to hide ATutor\\''s content navigation menu so that content will be displayed in a linear presentation. Hiding the content menu also conserves space for users viewing ATutor on smaller screens.</li>\\r\\n\\r\\n<li><strong>Search and Sort:</strong> Most data tables are accompanied by a search tool, or filter, so specific records can be displayed in the table, reducing the amount of data displayed at any given time. Most data tables can also be sorted by selecting the column header label, again allowing users to narrow down the data display.</li>\\r\\n\\r\\n<li><strong>Table  Header Associations: </strong>All data tables are marked up with the TH element and the scope attribute to ensure that screen reader users are able to navigate through data displays and understand what each data cell represents.</li>\\r\\n\\r\\n<li><strong>Form Labels: </strong>All form fields throughout ATutor are marked up using the LABEL element to ensure that they are properly described for assistive technology users. Explicit labeling in this manner also makes it possible to click on a form field\\''s label to activate the field. This provides a larger target area for those people who have difficulty positioning a mouse pointer on a small form field such as a radio button or a checkbox.</li>\\r\\n\\r\\n<li><strong>Style Sheets: </strong>Wherever possible, the presentation of content in ATutor is controlled by style sheet elements. This allows users to override ATutor\\''s default appearance and apply their own preferred presentation styles (i.e. increased font sizes, different font styles, colours, etc.)</li>\\r\\n\\r\\n<li><strong>Form Field Focus: </strong>For pages where the primary content is a form, the cursor will automatically be placed in the first field so that after a form page loads, users can begin typing into the form.  Users may choose to disable form focus in their preference settings if it interferes with their use of form screens.</li>\\r\\n\\r\\n<li><strong>Relative Sizing of Images: </strong>With browsers that support resizing of images, ATutor icons can be magnified for users with low vision, making them more easily visible. (e.g. Netscape 7 press Alt +) . Wherever possible relative measures have also been used for other feature within ATutor so when the interface is magnified or reduced, all features resize relative to each other, maintaining the screen\\''s symmetry.</li>\\r\\n\\r\\n</ol>', '2013-02-06 16:22:44', ''),
